import React from 'react';
import { Route } from 'react-router-dom';
import HomePage from './pages/homepage/homePage';
import './App.css';

const HatsPage = () => {
  return(
  <div>
    Hats Hats Hats
  </div>
  );
}

function App() {
  return (
    <div>
      <Route exact path='/hats' component={HatsPage}/>
      <HomePage />
    </div>
  );
}

export default App;
